# Xử Lý Outliers 
lower = 0.25
higher = 0.75
outlier_columns = ['age', 'duration', 'previous', 'campaign']
for column in outlier_columns:     
    Q1 = d[column].quantile(.25)
    Q3 = d[column].quantile(.75)
    IQR = Q3 - Q1
    lower = Q1 - 1.5 * IQR
    upper = Q3 + 1.5 * IQR
    d = d[d[column] >= lower] 
    d = d[d[column] <=upper]

